INSERT INTO `v1_ff721e1cd1e602ef4430c30c61ccf25eb3c0757a26b154e7bfaf9c04c63af847` VALUES (11506, 1, 1.21875, "チカのサマーピンバッジ", 1.21875, "サマー衣装のチカがかわいく描かれたピンバッジ。限定バージョ\nンのデザインはサマーライブ参加の証。夏を満喫中のチカの表情\nが魅力的な一品。", 3);
INSERT INTO `v1_ff721e1cd1e602ef4430c30c61ccf25eb3c0757a26b154e7bfaf9c04c63af847` VALUES (11601, 1, 0.75, "ツムギのボトルキャップ", 0.625, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 6);
